import React from 'react';
import './home_page.css';
import fruitsImage from '../assets/fruits.jpg'; // ✅ Import image

const HomePage = () => {
  return (
    <div 
      className="home"
      style={{ backgroundImage: `url(${fruitsImage})` }}  // ✅ Use imported image
    >
      <h1>Welcome to my website</h1>
    </div>
  );
};

export default HomePage;
